TEST_F(ApiDavidTest, CountNotify_Create)
{
    rtCntNotify_t inNotify;
    rtError_t error = rtCntNotifyCreate(0, &inNotify);
    EXPECT_EQ(error, RT_ERROR_NONE);

    uint32_t notifyId = 0;
    error = rtGetCntNotifyId(inNotify, &notifyId);
    EXPECT_EQ(error, RT_ERROR_NONE);

    NpuDriver drv;
    ((CountNotify *)inNotify)->driver_ = (Driver *)(&drv);
    MOCKER(halResAddrMap).stubs().will(returnValue(DRV_ERROR_NONE));
    uint64_t notifyAddr = 0;
    error = rtGetCntNotifyAddress(inNotify, &notifyAddr, NOTIFY_CNT_ST_SLICE);
    EXPECT_EQ(error, RT_ERROR_NONE);

    MOCKER_CPP(&CountNotify::GetCntNotifyAddress).stubs().will(returnValue(RT_ERROR_DRV_NOT_SUPPORT));
    error = rtGetCntNotifyAddress(inNotify, &notifyAddr, NOTIFY_CNT_ST_SLICE);
    EXPECT_NE(error, RT_ERROR_NONE);

    error = rtCntNotifyDestroy(inNotify);
    EXPECT_EQ(error, RT_ERROR_NONE);
}

