TEST_F(ApiDavidTest, memset_async)
{
    rtError_t error = RT_ERROR_NONE;
    void *devPtr;
    void *tmp_devPtr = (void *)0x10000000;
    rtDavidSqe_t *sqe = (rtDavidSqe_t *)malloc(2048 * sizeof(rtDavidSqe_t));
    uint64_t oldSqAddr = stream_->GetSqBaseAddr();
    uint64_t newSqAddr = reinterpret_cast<uint64_t>(sqe);
    stream_->SetSqBaseAddr(newSqAddr);    

    error = rtMalloc(&devPtr, 60, RT_MEMORY_HBM, DEFAULT_MODULEID);
    EXPECT_EQ(error, RT_ERROR_NONE);

    error = rtMemsetAsync(devPtr, 60, 0, 100, stream_);
    EXPECT_EQ(error, ACL_ERROR_RT_PARAM_INVALID);

    error = rtMemsetAsync(devPtr, 60, 0, 60, stream_);
    EXPECT_EQ(error, RT_ERROR_NONE);

    rtModel_t rtModel;
    error = rtModelCreate(&rtModel, 0);
    EXPECT_EQ(error, RT_ERROR_NONE);
    Model *model = static_cast<Model *>(rtModel);
    stream_->SetBindFlag(true);
    stream_->SetModel(model);

    error = rtMemsetAsync(devPtr, 60, 0, 60, stream_);
    EXPECT_EQ(error, RT_ERROR_NONE);

    stream_->SetBindFlag(false);
    error = rtFree(devPtr);
    EXPECT_EQ(error, RT_ERROR_NONE);

    NpuDriver * rawDrv = new NpuDriver();
    uint32_t memsize = 64*1024*1024;
    rtPointerAttributes_t rtAttributes;
    rtAttributes.deviceID = 0;
    rtAttributes.memoryType = RT_MEMORY_TYPE_DEVICE;
    rtAttributes.locationType = RT_MEMORY_LOC_DEVICE;
    MOCKER_CPP_VIRTUAL(rawDrv, &NpuDriver::PointerGetAttributes)
                    .stubs()
                    .with(outBoundP(&rtAttributes, sizeof(rtAttributes)), mockcpp::any())
                    .will(returnValue(RT_ERROR_NONE));

    error = rtMalloc(&devPtr, memsize+1, RT_MEMORY_HBM, DEFAULT_MODULEID);
    EXPECT_EQ(error, RT_ERROR_NONE);

    rtFlushCache(devPtr, memsize+1);

    error = rtMemsetAsync(devPtr, memsize+1, 0, memsize+1, stream_);
    EXPECT_EQ(error, RT_ERROR_NONE);

    MOCKER(MemcopyAsync).stubs().will(invoke(MemcopyAsync_stub));
    error = rtMemsetAsync(devPtr, memsize+1, 0, memsize+1, stream_);
    EXPECT_NE(error, RT_ERROR_NONE);
    MOCKER(memset_s).stubs().will(invoke(memset_s_stub));
    error = rtMemsetAsync(devPtr, memsize+1, 0, memsize+1, stream_);
    EXPECT_NE(error, RT_ERROR_NONE);

    error = rtMemsetAsync(tmp_devPtr, 60, 0, 65 * 1024 * 1024, stream_);
    EXPECT_NE(error, RT_ERROR_NONE);
    stream_->SetSqBaseAddr(oldSqAddr);
    TaskResManageDavid *taskResMang = ((TaskResManageDavid *)(static_cast<Stream *>(stream_)->taskResMang_));
    RecycleModelBindStreamAllTask(stream_, false);
    taskResMang->ResetTaskRes();
    Stream * defaultStm = stream_->Context_()->DefaultStream_();
    taskResMang = ((TaskResManageDavid *)(static_cast<Stream *>(defaultStm)->taskResMang_));
    RecycleModelBindStreamAllTask(defaultStm, false);
    taskResMang->ResetTaskRes();
    error = rtFree(devPtr);
    EXPECT_EQ(error, RT_ERROR_NONE);

    free(sqe);
    sqe = nullptr;
    delete rawDrv;
}

