extern int32_t faultEventFlag;
TEST_F(ApiDavidTest, rtsGetErrorVerbose_HBM_UCE_ERROR)
{
    rtError_t error;
    Runtime *rtInstance = (Runtime *)Runtime::Instance();
    device_ = ((Runtime *)Runtime::Instance())->DeviceRetain(0, 0);
    stream_->Context_()->SetFailureError(1);
    rtErrorInfo errorInfo = {};
    GlobalMockObject::verify();
    faultEventFlag = 0;
    device_->SetDeviceFaultType(DeviceFaultType::HBM_UCE_ERROR);

    error = rtsGetErrorVerbose(0,  &errorInfo);
    EXPECT_EQ(errorInfo.errorType, RT_ERROR_MEMORY);
    EXPECT_EQ(errorInfo.detail.uceInfo.repairAddrArray[0].ptr, 16);
    EXPECT_EQ(error, RT_ERROR_NONE);

    // view cache
    rtMemUceInfo *memUceInfo = GlobalContainer::GetMemUceInfo(0);
    EXPECT_EQ((*memUceInfo).count, 2);

    // get hbm uce info again
    errorInfo = {};
    error = rtsGetErrorVerbose(0,  &errorInfo);
    EXPECT_EQ(errorInfo.errorType, RT_ERROR_MEMORY);
    EXPECT_EQ(errorInfo.detail.uceInfo.repairAddrArray[0].ptr, 16);
    EXPECT_EQ(error, RT_ERROR_NONE);

    // view cache
    memUceInfo = GlobalContainer::GetMemUceInfo(0);
    EXPECT_EQ((*memUceInfo).count, 2);

    // geterror nonetry repair = 1
    error = rtsRepairError(0,  &errorInfo);
    EXPECT_EQ(error, RT_ERROR_NONE);

    // the cache is cleared
    memUceInfo = GlobalContainer::GetMemUceInfo(0);
    EXPECT_EQ((*memUceInfo).count, 0);

    device_->SetDeviceFaultType(DeviceFaultType::NO_ERROR);
}

