    Kernel *k1 = new Kernel(&fun1, "f1", "", program, 10);
    k1->userParaNum_ = 0;
    k1->systemParaNum_ = 0;
    k1->isSupportOverFlow_ = false;
    k1->isNeedSetFftsAddrInArg_ = false;
    k1->SetKernelRegisterType(RT_KERNEL_REG_TYPE_NON_CPU);
    k1->mixType_ = MIX_AIV;
 
