    MOCKER(StreamLaunchCpuKernelExWithArgs).stubs().will(returnValue(RT_ERROR_NONE));
    MOCKER(StreamLaunchKernelV2).stubs().will(returnValue(RT_ERROR_NONE));
 
    ApiImplDavid impl;
    error = impl.LaunchKernelByHandle(k1, 1U, argsInfo, stream, taskCfg);
    EXPECT_EQ(error, RT_ERROR_NONE);
 
    rtLaunchKernelAttr_t attrs[4];
    attrs[0].id = RT_LAUNCH_KERNEL_ATTR_ENGINE_TYPE;
