    fusionInfo.subTask[1].type = RT_FUSION_AICORE;
    fusionInfo.subTask[1].task.aicoreInfo.hdl = &hdl;
    fusionInfo.subTask[1].task.aicoreInfo.tilingKey = tilingKey;
