TEST_F(ApiDavidTest, rtsValueWait_failed)
{
    MOCKER(halSqTaskSend).stubs().will(returnValue(DRV_ERROR_NO_DEVICE));

    Context *curCtx = Runtime::Instance()->CurrentContext();
    Stream *defaultStm = curCtx->DefaultStream_();
    defaultStm->SetSqMemAttr(false);
    defaultStm->Context_()->DefaultStream_()->SetSqMemAttr(false);
    defaultStm->abortStatus_ = RT_ERROR_NONE;
    rtDavidSqe_t *sqe = (rtDavidSqe_t *)malloc(3 * sizeof(rtDavidSqe_t));
    uint64_t oldSqAddr = defaultStm->GetSqBaseAddr();
    uint64_t newSqAddr = reinterpret_cast<uint64_t>(sqe);
    defaultStm->SetSqBaseAddr(newSqAddr);

    void * devPtr;
    uint64_t value = 0;
    uint32_t flag = 0;

    rtError_t error = rtMalloc(&devPtr, 100, RT_MEMORY_HBM, DEFAULT_MODULEID);
    EXPECT_EQ(error, RT_ERROR_NONE);

    error = rtsValueWait(devPtr, value, flag, nullptr);
    EXPECT_EQ(error, ACL_ERROR_RT_DRV_INTERNAL_ERROR);

    defaultStm->SetSqBaseAddr(oldSqAddr);
    TaskResManageDavid *taskResMang = ((TaskResManageDavid *)(static_cast<Stream *>(defaultStm)->taskResMang_));
    taskResMang->ResetTaskRes();
    free(sqe);
    sqe = nullptr;

    error = rtFree(devPtr);
    EXPECT_EQ(error, RT_ERROR_NONE);
}

